import React, {Fragment} from "react";
import { Redirect } from 'react-router-dom'
import { connect } from 'react-redux'
import { passEmailAndPass } from './redux/actions/user_actions'

class Dashboard extends React.Component{
    render(){
        return (
            <Fragment>
                <form onSubmit={this.handleSubmit} className='form'>
                <p className='field half'>
                    <select className='select' name="location" id='select'>
                    <option value='' selected disabled>Choose Sport:</option>
                    </select>
                </p> 
                </form>
                <div className="main">  
                <p>Yo</p>
                </div>
            </Fragment>
        );
    }
}

function msp(state){
    return {
      email: state.userReducer.email,
      password: state.userReducer.password
    }
}

export default connect(msp, { passEmailAndPass })(Dashboard)
